import React, { useState } from "react";
import data from "./data/data";
import Questions from "./Questions";
import {
  AiFillInstagram,
  AiFillTwitterCircle,
  AiFillLinkedin,
  AiFillGithub,
} from "react-icons/ai";

function App() {
  // set up my useState
  const [questions, setQuestions] = useState(data);

  // console.log(data);
  return (
    <main>
      <div className='container'>
        <h3>Questions and Answers</h3>
        <section className='info'>
          {questions.map((question) => {
            return <Questions key={question.id} {...question} />;
          })}
        </section>
        <footer>
          <h4>Pleaee visit my personal links</h4>
          <a href=''>
            <AiFillInstagram />
          </a>
          <a href=''>
            <AiFillTwitterCircle />
          </a>
          <a href='https://www.linkedin.com/in/seta-rose-33014219a/'>
            <AiFillLinkedin />
          </a>
          <a href='https://github.com/seth808rose' className="">
            <AiFillGithub />
          </a>
        </footer>
      </div>
    </main>
  );
}

export default App;
